INSERT INTO `news` (`news_id`, `author`, `title`, `description`, `url`, `urlToImage`, `date`, `priority`, `publishedAt`, `source`) VALUES
(1, 'Spriha Srivastava, David Reid, Luke Graham', 'Live: Countdown to UK election begins; PM May toughens anti-terrorism stance', 'Our live blog is tracking market reactions as the countdown begins for the UK voters to cast their ballot.', 'http://www.cnbc.com/2017/06/07/live-countdown-to-uk-election-begins-pm-may-toughens-anti-terrorism-stance.html', 'http://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/06/05/104510329-RTX38XEM-theresa-may.1910x1000.jpg', '2017-06-07 06:28:19', 1, '2017-06-07T04:47:25Z', 'CNBC'),
(2, 'Tom DiChristopher', 'US oil output poised to hit 10 million barrels a day next year, breaking 1970 record, EIA says', 'U.S. oil production will crack a nearly 50-year record in 2018, rising to 10 million barrels a day, the EIA forecast.', 'http://www.cnbc.com/2017/06/06/us-oil-output-to-hit-record-10-million-barrels-a-day-next-year-eia.html', 'http://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2015/12/09/103230022-GettyImages-109438421.1910x1000.jpg', '2017-06-07 06:28:19', 2, '2017-06-06T22:33:11Z', 'CNBC'),
(3, 'Ed Lane', 'Trump reportedly asked national intelligence chief to get Comey to ease Flynn probe', 'President Trump reportedly asked DNI Coats to get former FBI chief James Comey to ease a probe into Mike Flynn.', 'http://www.cnbc.com/2017/06/06/trump-reportedly-asked-national-intelligence-chief-to-get-comey-to-ease-flynn-probe.html', 'https://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/06/05/104510873-RTX39556-donald-trump.1910x1000.jpg', '2017-06-07 06:28:19', 3, '2017-06-07T01:13:27Z', 'CNBC'),
(4, 'Leslie Shaffer', 'Comey reportedly told Sessions he did not want to meet alone with Trump', 'Former FBI director James Comey reportedly sought the help of U.S. Attorney General Jeff Sessions to avoid one-on-one meetings with Trump.', 'http://www.cnbc.com/2017/06/06/comey-reportedly-told-sessions-he-did-not-want-to-meet-alone-with-trump.html', 'https://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/06/06/104514000-GettyImages-677914388-james-comey.1910x1000.jpg', '2017-06-07 06:28:19', 4, '2017-06-07T01:06:44Z', 'CNBC'),
(5, 'Deirdre Bosa, Anita Balakrishnan, Todd Haselton', 'Uber fires more than 20 employees — including senior employees — after internal investigation', 'More than 20 employees have been fired from Uber after a sexual harassment investigation.', 'http://www.cnbc.com/2017/06/06/more-than-20-employees-fired-at-uber-in-sexual-harassment-investigation-report.html', 'https://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/06/01/104504159-RTX2I8Y7-Travis-Kalanick.1910x1000.jpg', '2017-06-07 06:28:19', 5, '2017-06-06T21:14:03Z', 'CNBC'),
(6, 'Eunice Yoon', 'Officials say they''re still positive: The future of clean energy is bright—with or without the US', 'A ministerial-level meeting in China days after Donald Trump yanked the U.S. from the Paris accord on climate found an upbeat tone on cutting carbon.', 'http://www.cnbc.com/2017/06/06/officials-say-theyre-still-positive-the-future-of-clean-energy-is-bright-with-or-without-the-us.html', 'https://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/05/03/104445697-RTS14HJJ.1910x1000.jpg', '2017-06-07 06:28:19', 6, '2017-06-07T02:29:26Z', 'CNBC'),
(7, 'CNBC', 'Sears is closing 66 more stores', 'Sears Holdings is closing 66 more stores in its drive to bring its Sears and Kmart stores back to profitability, according to USA Today.', 'https://www.usatoday.com/story/money/2017/06/06/report-sears-closing-72-additional-stores/102563986/', 'https://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/03/22/104357199-GettyImages-136142964.1910x1000.jpg', '2017-06-07 06:28:19', 7, '2017-06-06T23:49:56Z', 'CNBC'),
(8, 'Lori Ann LaRocco', 'Commerce Department to release report on manufacturing regulation early next week', 'The Commerce Department will issue a report on "streamlining permitting and reducing regulatory burdens for domestic manufacturing" next week, officials said.', 'http://www.cnbc.com/2017/06/06/commerce-department-to-release-report-on-manufacturing-regulation-early-next-week.html', 'http://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/04/27/104431307-IMG_0034.1910x1000.JPG', '2017-06-07 06:28:19', 8, '2017-06-07T02:01:11Z', 'CNBC'),
(9, 'Robert Ferris', 'Elon Musk wants to make it easier for city dwellers to own Teslas', 'Tesla is building a new version of its high speed Supercharger stations in cities to make it easier for apartment dwellers to own Tesla cars', 'http://www.cnbc.com/2017/06/06/tesla-making-superchargers-designed-for-apartment-dwellers-in-cities.html', 'http://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/04/24/104422283-GettyImages-597435754.1910x1000.jpg', '2017-06-07 06:28:19', 9, '2017-06-06T23:58:10Z', 'CNBC'),
(10, 'Arjun Kharpal', '''Seduction'' of China market too great for US tech firms like Google to ignore, trade body CEO says', 'Gary Shapiro, CEO of the CTA, said there are "challenges" for U.S. tech firms trying to get into China, but ultimately it''s "worth it".', 'http://www.cnbc.com/2017/06/06/us-tech-firms-china-ces-asia.html', 'http://fm.cnbc.com/applications/cnbc.com/resources/img/editorial/2017/05/02/104441570-GettyImages-137983344.1910x1000.jpg', '2017-06-07 06:28:19', 10, '2017-06-07T01:50:27Z', 'CNBC'),
(11, 'Chris Strohm', 'Sessions Has Suggested Resigning as Tensions Grow With Trump', 'U.S. Attorney General Jeff Sessions had suggested in the past several weeks he might resign amid a widening rift with President Donald Trump, according to a person familiar with the matter.', 'https://www.bloomberg.com/politics/articles/2017-06-07/sessions-said-to-suggest-resigning-as-tensions-grow-with-trump', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/inq5QYmtL8jI/v0/1200x774.jpg', '2017-06-07 06:28:20', 1, '2017-06-07T03:21:53.565Z', 'BLOOMBERG'),
(12, 'Brendan Scott', 'China Missiles Able to Send Nukes to Western Pacific, U.S. Says', 'China deployed new ballistic missiles last year capable of delivering nuclear warheads to ground targets in the Western Pacific, the Pentagon said.', 'https://www.bloomberg.com/politics/articles/2017-06-07/china-missiles-able-to-send-nukes-to-western-pacific-u-s-says', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/in.LEBQlonaE/v2/1200x619.jpg', '2017-06-07 06:28:20', 2, '2017-06-07T01:12:57.198Z', 'BLOOMBERG'),
(13, 'Jack Sidders', 'London''s Big Bang Banking Hub Pivots for Post-Brexit Reinvention', 'For 30 years, an army of UBS Group AG traders packed the football-field-sized floors of a building in the City of London’s largest office project. Now teams of laborers in high-visibility jackets are busily transforming the property for a different type of worker.', 'https://www.bloomberg.com/news/articles/2017-06-07/london-s-big-bang-banking-hub-pivots-for-post-brexit-reinvention', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/igdVhJo3ur68/v0/1200x789.jpg', '2017-06-07 06:28:20', 3, '2017-06-07T04:00:01Z', 'BLOOMBERG'),
(14, '', 'Christie Deputy, Ex-Goldman Sachs Executive Win Primaries', 'Voters on Tuesday chose a wealthy former Goldman Sachs executive and Republican Gov. Chris Christie''s top deputy to run to replace the unpopular governor.', 'https://www.bloomberg.com/politics/articles/2017-06-06/new-jersey-set-to-vote-to-replace-unpopular-christie', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/iARVuTrSznFQ/v0/1200x800.jpg', '2017-06-07 06:28:20', 4, '2017-06-06T04:20:37.018Z', 'BLOOMBERG'),
(15, 'Jonathan Bernstein', 'Trump''s Presidential Theater of the Absurd', 'Republican-aligned media accepts and amplifies whatever he says, setting up terrible incentives.', 'https://www.bloomberg.com/view/articles/2017-06-06/trump-s-presidential-theater-of-the-absurd', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/i43KqkkYkyAI/v0/1200x1181.jpg', '2017-06-07 06:28:20', 5, '2017-06-06T21:35:48.714Z', 'BLOOMBERG'),
(16, '', 'Red Sox Announcer Remy Says Tanaka Shouldn''t Get Translator', 'New York (AP) -- Boston Red Sox broadcaster Jerry Remy says pitchers such as Yankees right-hander Masahiro Tanaka shouldn''t be allowed translators on the mound and should instead "learn baseball language."', 'https://www.bloomberg.com/news/articles/2017-06-07/red-sox-announcer-remy-says-tanaka-shouldn-t-get-translator', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/iVVsg6k9iS04/v0/1200x844.jpg', '2017-06-07 06:28:20', 6, '2017-06-07T02:15:43.766Z', 'BLOOMBERG'),
(17, 'David Stringer', 'Robot Ghost Ships to Extend Miner''s Technology Drive to Seas', 'BHP Billiton Ltd., the world’s biggest mining company, is studying the introduction of giant, automated cargo ships to carry everything from iron ore to coal as part of a strategic shift that may disrupt the $334 billion global shipping industry.', 'https://www.bloomberg.com/news/articles/2017-06-06/robot-ghost-ships-to-take-miner-s-technology-drive-on-high-seas', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/ibl_t9.dotPM/v0/1200x800.jpg', '2017-06-07 06:28:20', 7, '2017-06-06T23:03:56.402Z', 'BLOOMBERG'),
(18, 'Kim Bhasin, Lindsey Rupp', 'J. Crew May Never Be the Same Again', 'Fashion left the company, and its executives, behind. Now what?', 'https://www.bloomberg.com/news/articles/2017-06-06/j-crew-may-never-be-the-same-again', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/ixdc7NjszLbs/v0/1200x800.jpg', '2017-06-07 06:28:20', 8, '2017-06-06T17:42:17.079Z', 'BLOOMBERG'),
(19, 'Prudence Ho', 'Chinese Giants Are Taking Over Hong Kong', 'Banks, real estate, telecoms show biggest Chinese influence', 'https://www.bloomberg.com/news/features/2017-06-06/chinese-giants-are-taking-over-hong-kong', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/iFdtnwmOnqEc/v0/-1x-1.jpg', '2017-06-07 06:28:20', 9, '2017-06-06T16:00:06.637Z', 'BLOOMBERG'),
(20, 'Lucas Shaw', 'Apple Taps Jessica Alba, Gwyneth Paltrow to Front Video Hopes', 'A day after Apple Inc. announced updates to its computers, watches and phones, the company packed a couple thousand software developers into a theater for an early look at its next big thing: an online TV show featuring Jessica Alba and Gwyneth Paltrow.', 'https://www.bloomberg.com/news/articles/2017-06-06/apple-taps-jessica-alba-gwyneth-paltrow-to-front-video-hopes', 'https://assets.bwbx.io/images/users/iqjWHBFdfxIU/iylkXcNyA6zE/v0/1200x800.jpg', '2017-06-07 06:28:20', 10, '2017-06-06T23:12:43.871Z', 'BLOOMBERG'),
(21, 'David SchoenfieldESPN Senior Writer ', 'Real or not? Did Scooter Gennett have the best offensive performance ever?', 'The 27-year-old infielder became one of just 17 players in MLB history to record a four-homer game, a performance that ranks among the best ever.', 'http://www.espn.com/blog/sweetspot/post/_/id/80215/real-or-not-did-scooter-gennett-have-the-best-offensive-performance-ever', 'http://a1.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0606%2Fr216111_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 1, '2017-06-07T03:29:59Z', 'ESPN'),
(22, NULL, '2017 Women''s College World Series -- Oklahoma Sooners started postseason with loss to North Dakota State, ended it as national champions', 'Oklahoma opened the postseason with a loss to North Dakota State and ended it as repeat national champions. How the Sooners found their way -- no magic required -- on an incredible 19-day journey.', 'http://www.espn.com/espnw/sports/article/19565484/2017-women-college-world-series-oklahoma-sooners-started-postseason-loss-north-dakota-state-ended-national-champions', 'http://a4.espncdn.com/media/motion/2017/0607/dm_170607_WCWS_Oklahoma_v_Florida_Highlight/dm_170607_WCWS_Oklahoma_v_Florida_Highlight.jpg', '2017-06-07 06:28:20', 2, NULL, 'ESPN'),
(23, 'Zach LoweESPN Senior Writer ', 'Zach Lowe: How LeBron, Cavs can sharpen attack versus Warriors'' dazzling D', 'Golden State''s defense has thwarted the Cavs'' spectacular attack. What can LeBron James and Cleveland do to make the Finals competitive? Zach Lowe highlights the problems and potential solutions.', 'http://www.espn.com/nba/story/_/id/19557495/zach-lowe-golden-state-warriors-defense-dominating-cleveland-cavaliers-2017-nba-finals', 'http://a4.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0606%2Fr215854_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 3, '2017-06-06T15:00:00Z', 'ESPN'),
(24, 'Kyle Wagner and Tony Chow', 'How The Cavs Can Push Back In Game 3', 'In the video above, FiveThirtyEight’s Kyle Wagner breaks down some things the Cleveland Cavaliers can do to stay competitive in the NBA Finals as the series heads back to Cleveland.', 'https://fivethirtyeight.com/features/how-the-cavs-can-push-back-in-game-3/', 'https://s0.wp.com/wp-content/themes/vip/espn-fivethirtyeight/assets/images/open-graph-placeholder-sports.png', '2017-06-07 06:28:20', 4, '2017-06-06T18:26:04Z', 'ESPN'),
(25, 'Matt WilanskyESPN.com ', 'ICYMI at French Open: More rain, more upsets, more Serena Williams', 'Once again, inclement weather was a major factor, so much so that Novak Djokovic and Rafael Nadal never had a chance to walk onto the court.', 'http://www.espn.com/tennis/story/_/id/19562084/icymi-french-open-more-rain-more-upsets-more-serena-williams', 'http://a1.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0606%2Fr215969_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 5, '2017-06-06T20:17:33Z', 'ESPN'),
(26, 'Peter BodoTennis ', 'W2W4 at French Open: Novak Djokovic faces stern test', 'Novak Djokovic and Rafael Nadal had to wait an extra day because of the rain, but they''re hoping to roll into the French Open semifinals.', 'http://www.espn.com/tennis/story/_/id/19559871/french-open-2017-quarterfinal-preview-novak-djokovic-faces-stern-test-simona-halep-looks-stay-hot', 'http://a3.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0604%2Fr215341_2_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 6, '2017-06-05T21:13:00Z', 'ESPN'),
(27, 'Bonnie D. FordESPN Senior Writer ', 'Surprise! Bacsinszky, Ostapenko set up birthday party', 'After their upset quarterfinal wins, 30th-seeded Timea Bacsinszky and unseeded Jelena Ostapenko will share the birthday spotlight Thursday by facing off at Roland Garros. The winner''s gift will be a spot in the French Open final.', 'http://www.espn.com/tennis/story/_/id/19562399/french-open-upset-winners-bacsinszky-jelena-ostapenko-set-semifinal-birthday-showdown', 'http://a4.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0606%2Fr215921_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 7, '2017-06-06T21:15:00Z', 'ESPN'),
(28, 'Brett OkamotoESPN Staff Writer ', 'The final days of MMA fighter Kimbo Slice', 'Kimbo Slice died unexpectedly on June 6, 2016. One year later, his family reflects on his fighting spirit throughout his career and during his final days.', 'http://www.espn.com/mma/story/_/id/19551302/the-final-days-mma-fighter-kimbo-slice', 'http://a4.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0605%2Fr215652_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 8, '2017-06-05T18:59:00Z', 'ESPN'),
(29, 'Scott LauberESPN Staff Writer ', 'In showdown against Aaron Judge, Red Sox''s Joe Kelly brings the heat', 'A high-intensity matchup brought out the best in the Boston reliever, whose fastball hit triple digits in striking out the hulking rookie sensation.', 'http://www.espn.com/blog/boston/red-sox/post/_/id/52637/in-showdown-against-aaron-judge-red-soxs-joe-kelly-brings-the-heat', 'http://a2.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0531%2Fr214239_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 9, '2017-06-07T04:59:09Z', 'ESPN'),
(30, 'Andrew MarchandESPN Senior Writer ', 'Yankees need to drop Masahiro Tanaka from rotation', 'The struggling pitcher has been terrible, and if the Yankees don''t come up with a solution soon, he could cost the team the division.', 'http://www.espn.com/blog/new-york/yankees/post/_/id/96417/yankees-need-to-drop-masahiro-tanaka-from-rotation', 'http://a.espncdn.com/combiner/i?img=%2Fphoto%2F2017%2F0606%2Fr216098_1296x729_16%2D9.jpg', '2017-06-07 06:28:20', 10, '2017-06-07T04:15:35Z', 'ESPN'),
(31, 'Evan Perez, Tom LoBianco and Sara Murray, CNN', 'AG Jeff Sessions offered to quit', 'President Donald Trump and Attorney General Jeff Sessions have had a series of heated exchanges in the last several weeks after Sessions recused himself from the Russia probe, a source close to Sessions told CNN Tuesday.', 'http://www.cnn.com/2017/06/06/politics/trump-and-sessions-have-had-heated-exchange/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170310175408-donald-trump-jeff-sessions-super-tease.jpg', '2017-06-07 06:28:20', 1, '2017-06-07T01:19:07Z', 'CNN'),
(32, 'Jeremy Diamond, CNN', 'White House won''t say if Trump has confidence in AG Sessions', 'White House press secretary Sean Spicer on Tuesday declined to say whether President Donald Trump has confidence in Attorney General Jeff Sessions.', 'http://www.cnn.com/2017/06/06/politics/trump-sessions-spicer-confidence/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170310175408-donald-trump-jeff-sessions-super-tease.jpg', '2017-06-07 06:28:20', 2, '2017-06-06T20:47:04Z', 'CNN'),
(33, 'Gloria Borger, Eric Lichtblau, Jake Tapper and Brian Rokus, CNN', 'Comey expected to refute Trump', 'In his much-anticipated congressional testimony on Thursday, fired FBI Director James Comey will dispute President Donald Trump''s interpretation of their conversations, according to sources familiar with Comey''s thinking.', 'http://www.cnn.com/2017/06/06/politics/comey-testimony-refute-trump-russian-investigation/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170509184402-james-comey-0503-super-tease.jpg', '2017-06-07 06:28:20', 3, '2017-06-07T03:08:04Z', 'CNN'),
(34, NULL, 'How James Comey is preparing for this moment - CNN Video', 'CNN''s Gloria Borger, Evan Perez and Eric Lichtblau on James Comey''s approach towards big moments and what he is hoping to accomplish on Thursday.', 'http://www.cnn.com/videos/politics/2017/06/06/how-comey-is-preparing-for-this-moment-orig-jm.cnn', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170606164250-james-comey-fbi-quad-split-super-tease.jpg', '2017-06-07 06:28:20', 4, NULL, 'CNN'),
(35, 'Tom LoBianco, CNN', '5 things to watch: Coats, Rogers, McCabe and Rosenstein testify', 'The Senate intelligence committee is back in the national spotlight for two days of blockbuster hearings and following news that relations between President Donald Trump and Attorney General Jeff Sessions had reached a boiling point surrounding his recusal from the Justice Department''s Russia investigation.', 'http://www.cnn.com/2017/06/07/politics/russia-hearing-what-to-watch/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170523100218-dni-hearing-super-tease.jpg', '2017-06-07 06:28:20', 5, '2017-06-07T05:03:30Z', 'CNN'),
(36, 'Evan Perez and Shimon Prokupecz, CNN', 'CNN Exclusive: US suspects Russian hackers planted fake news behind Qatar crisis', 'US investigators believe Russian hackers breached Qatar''s state news agency and planted a fake news report that contributed to a crisis among the US'' closest Gulf allies, according to US officials briefed on the investigation.', 'http://www.cnn.com/2017/06/06/politics/russian-hackers-planted-fake-news-qatar-crisis/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170606115750-qatar-rift-t1-super-tease.jpg', '2017-06-07 06:28:20', 6, '2017-06-07T00:21:22Z', 'CNN'),
(37, 'Nicole Gaouette and Barbara Starr, CNN', 'Trump appears to take credit for Gulf nations'' move against Qatar', 'President Donald Trump appeared to take credit for the decision of major Gulf nations to cut diplomatic relations with Qatar, an important US ally, putting his stamp of approval on the move despite Pentagon and State Department attempts to remain neutral.', 'http://www.cnn.com/2017/06/06/politics/trump-qatar-ideology/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170530114725-01-donald-trump-solo-file-super-tease.jpg', '2017-06-07 06:28:20', 7, '2017-06-07T00:00:48Z', 'CNN'),
(38, 'James Griffiths, CNN', 'North Korea accuses Trump of being ''selfish'' over Paris climate pact', 'US President Donald Trump''s decision to withdraw from the Paris climate agreement has been criticized by major global powers -- and now North Korea is getting in on the act.', 'http://www.cnn.com/2017/06/07/asia/north-korea-trump-climate-change/index.html', 'http://i2.cdn.cnn.com/cnnnext/dam/assets/170607113204-north-korea-juche-tower-pyongyang-super-tease.jpg', '2017-06-07 06:28:20', 8, '2017-06-07T04:11:09Z', 'CNN'),
(39, 'Matt Egan', 'Oil lobby met with interior secretary at Trump hotel', 'The oil industry''s most powerful lobbying group met last spring with President Trump''s interior secretary at the Trump International Hotel on the same day the administration killed a rule that oil companies strongly opposed.', 'http://money.cnn.com/2017/06/06/investing/oil-lobby-trump-hotel-api/index.html', 'http://i2.cdn.turner.com/money/dam/assets/161115151104-trump-washington-hotel-780x439.jpg', '2017-06-07 06:28:20', 9, '2017-06-06T04:31:03Z', 'CNN'),
