(86, 'Reuters', 'Trump Urges Arab Unity After Suggesting Support for Campaign Against Qatar', 'Trump tweeted that his recent trip to the Middle East was "already paying off"', 'http://fortune.com/2017/06/07/trump-qatar-saudi-arabia/', 'https://fortunedotcom.files.wordpress.com/2017/06/gettyimages-686172214.jpg?w=720', '2017-06-07 06:28:23', 1, '2017-06-07T04:37:03Z', 'FORTUNE'),
(87, 'Polina Marinova', 'Uber Said to Have Fired More Than 20 Employees After Internal Investigation', 'A law firm reportedly looked into 215 claims at Uber, according to Bloomberg.', 'http://fortune.com/2017/06/06/uber-sexual-harassment-investigation/', 'https://fortunedotcom.files.wordpress.com/2017/03/uber1.jpg?w=720', '2017-06-07 06:28:23', 2, '2017-06-06T18:11:40Z', 'FORTUNE'),
(88, 'Robert Hackett', 'How the Feds Nabbed Suspected NSA Leaker Reality Winner', 'The forensic trail provided clues.', 'http://fortune.com/2017/06/06/leak-nsa-reality-winner/', 'https://fortunedotcom.files.wordpress.com/2017/06/rtx396xe.jpg?w=720', '2017-06-07 06:28:23', 3, '2017-06-06T19:51:16Z', 'FORTUNE'),
(89, 'Joshua Rhodes', 'How Trump Can Reduce Carbon Emissions Without the Paris Agreement', 'Trump seems unlikely to support a price on carbon after leaving the Paris climate agreement, but it would be a huge win for him.', 'http://fortune.com/2017/06/06/how-trump-can-reduce-carbon-emissions-without-the-paris-agreement/', 'https://fortunedotcom.files.wordpress.com/2017/06/gettyimages-643866700.jpg?w=720', '2017-06-07 06:28:23', 4, '2017-06-06T19:30:55Z', 'FORTUNE'),
(90, NULL, 'American Electric Power Wants More Women in the C-Suite', 'AEP CEO Nicholas Akins explains why.', 'http://fortune.com/video/2017/06/06/aep-ceo-women-in-the-c-suite/', 'https://fortunedotcom.files.wordpress.com/2017/06/leadership-00_05_27_06-still002.jpg?w=820&h=570&crop=1', '2017-06-07 06:28:23', 5, '2017-06-06T19:07:47Z', 'FORTUNE'),
(91, 'Brian Michael Jenkins', 'Why Aren’t There More Terrorist Attacks Like the One in London?', 'The question is not why the London Bridge attack happened, but why don’t more terrorist attacks occur? The answer may surprise you.', 'http://fortune.com/2017/06/07/london-bridge-attack/', 'https://fortunedotcom.files.wordpress.com/2017/06/692151756.jpg?w=720', '2017-06-07 06:28:23', 6, '2017-06-07T05:00:32Z', 'FORTUNE'),
(92, 'Reuters', 'SpaceX Will Launch the U.S. Air Force’s X-37B Space Plane', 'Elon Musk''s SpaceX will fly its first mission for the U.S. Air Force in August', 'http://fortune.com/2017/06/06/spacex-air-force-x-37b-space-plane/', 'https://fortunedotcom.files.wordpress.com/2017/06/rtr4ammq.jpg?w=720', '2017-06-07 06:28:23', 7, '2017-06-07T02:28:53Z', 'FORTUNE'),
(93, 'Reuters', 'Apple’s First TV Series To Premiere on Tuesday', 'It''s a close cousin to "Shark Tank."', 'http://fortune.com/2017/06/06/apple-first-tv-series-planet-of-the-apps/', 'https://fortunedotcom.files.wordpress.com/2017/06/rtx395bu.jpg?w=720', '2017-06-07 06:28:23', 8, '2017-06-07T00:09:22Z', 'FORTUNE'),
(94, 'Mathew Ingram', 'If Trump Blocks Someone on Twitter, Is That a First Amendment Issue?', 'The First Amendment Institute says it is, and that Trump should be forced to provide access to his tweets.', 'http://fortune.com/2017/06/06/trump-twitter-first-amendment/', 'https://fortunedotcom.files.wordpress.com/2017/06/1280-trumpaep.jpg?w=720', '2017-06-07 06:28:23', 9, '2017-06-06T22:50:13Z', 'FORTUNE'),
(95, 'Dan Hanzus', 'Marquette King uses tennis ball to avoid Romo fate', 'Nobody wants the fate of Tony Romo, who failed to handle a snap in a playoff game and went down in infamy because of it. The Raiders coaching staff came up with a solution to ensure that never happens.', 'http://www.nfl.com/news/story/0ap3000000813685/article/marquette-king-uses-tennis-ball-to-avoid-romo-fate', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813677_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 1, '2017-06-07T00:10:41+00:00', 'NFL'),
(96, 'Chris Wesseling', 'Jets reached out to Steve Smith about playing in 2017', 'The Jets are in full-blown rebuilding mode, jettisoning two more veterans this week. So why did Gang Green reach out to gauge Steve Smith''s interest in coming out of retirement?', 'http://www.nfl.com/news/story/0ap3000000813672/article/jets-reached-out-to-steve-smith-about-playing-in-2017', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813676_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 2, '2017-06-06T23:49:00+00:00', 'NFL'),
(97, 'Marc Sessler', 'New York Jets to part ways with wideout Eric Decker', 'The roster moves keep coming in New York. The Jets will release wide receiver Eric Decker if they can''t trade him, general manager Mike Maccagnan told reporters on Tuesday.', 'http://www.nfl.com/news/story/0ap3000000813583/article/new-york-jets-to-part-ways-with-wideout-eric-decker', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813570_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 3, '2017-06-06T23:15:00+00:00', 'NFL'),
(98, 'Chris Wesseling', 'Jimmy Garoppolo unlikely to sign extension with Pats', 'Jimmy Garoppolo says he would entertain the idea of signing a contract extension with the Patriots. How likely is that to happen with Tom Brady still playing at a high level?', 'http://www.nfl.com/news/story/0ap3000000813653/article/jimmy-garoppolo-unlikely-to-sign-extension-with-pats', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813566_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 4, '2017-06-06T23:03:00+00:00', 'NFL'),
(99, 'Dan Hanzus', 'Drew Brees'' legendary accuracy tested with trick shots', 'If you''re in the market for some squeaky clean sports-bro fun, look no further than the Dude Perfect trick-shot guys. And who''s a better match of the Dude Perfect sensibilities than Drew Brees?', 'http://www.nfl.com/news/story/0ap3000000813652/article/drew-brees-legendary-accuracy-tested-with-trick-shots', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813650_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 5, '2017-06-06T23:02:00+00:00', 'NFL'),
(100, 'Kevin Patra', 'Marshawn Lynch: Raiders move inspired my NFL return', 'Marshawn Lynch joined his hometown team in Oakland to great fanfare. The running back brings a connection to the community as the Raiders stare at a move to Las Vegas down the road.', 'http://www.nfl.com/news/story/0ap3000000813560/article/marshawn-lynch-raiders-move-inspired-my-nfl-return', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813554_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 6, '2017-06-06T21:15:00+00:00', 'NFL'),
(101, 'Kevin Patra', 'Coughlin: Blake Bortles has improved throwing motion', 'Jaguars QB Blake Bortles spent the offseason working with a QB guru to help improve his mechanics. Thus far through OTAs, coaches have had good things to report on Bortles'' improvement.', 'http://www.nfl.com/news/story/0ap3000000813524/article/coughlin-blake-bortles-has-improved-throwing-motion', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813522_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 7, '2017-06-06T19:24:00+00:00', 'NFL'),
(102, 'Jeremy Bergman', 'Marcus Mariota (leg) participating in full-team drills', 'Marcus Mariota has taken another step closer toward a total return to football. The Titans quarterback participated in full-team drills on Tuesday, according to ESPN''s Paul Kuharsky.', 'http://www.nfl.com/news/story/0ap3000000813505/article/marcus-mariota-leg-participating-in-fullteam-drills', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813503_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 8, '2017-06-06T18:39:00+00:00', 'NFL'),
(103, 'Conor Orr', 'New York Jets cut David Harris after 10 NFL seasons', 'The New York Jets are parting ways with its senior member on defense. Gang Green is releasing long-time linebacker David Harris, the team announced on Tuesday.', 'http://www.nfl.com/news/story/0ap3000000813476/article/new-york-jets-cut-david-harris-after-10-nfl-seasons', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813481_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 9, '2017-06-06T17:55:00+00:00', 'NFL'),
(104, 'Dan Hanzus', 'Friendly Cheeseheads give Davon House ride to OTAs', 'Packers CB Davon House was stuck in Minneapolis on Monday after inclement weather caused him to miss his connecting flight. To avoid missing the first day of OTAs, House took to Twitter for help.', 'http://www.nfl.com/news/story/0ap3000000813474/article/friendly-cheeseheads-give-davon-house-ride-to-otas', 'http://static.nfl.com/static/content/public/photo/2017/06/06/0ap3000000813468_thumbnail_200_150.jpg', '2017-06-07 06:28:23', 10, '2017-06-06T17:47:00+00:00', 'NFL'),
(105, 'Thomas Colson', 'The ''shy Tories'' phenomenon is growing and it means Theresa May could still win a landslide', 'Experts say there is a growing embarrassment factor attached to identifying as a Conservative voter.', 'http://uk.businessinsider.com/general-election-2017-behavioural-experts-warn-shy-tories-will-secure-tories-landslide-majority-2017-6', 'http://static4.uk.businessinsider.com/image/5936b2e8f1584822008b4b06-1190-625/the-shy-tories-phenomenon-is-growing-and-it-means-theresa-may-could-still-win-a-landslide.jpg', '2017-06-07 06:28:23', 1, '2017-06-07T06:01:00+00:00', 'BUSINESS-INSIDER-UK');
INSERT INTO `news` (`news_id`, `author`, `title`, `description`, `url`, `urlToImage`, `date`, `priority`, `publishedAt`, `source`) VALUES
(106, 'Jake Kanter', 'The fifth victim of the London Bridge terror attacks has been named, while 4 others are missing', 'A full list of those killed in the London Bridge and Borough Market terror attacks on Saturday.', 'http://uk.businessinsider.com/names-victims-london-bridge-borough-market-terror-attacks-2017-6', 'http://static4.uk.businessinsider.com/image/5937927956de781b008b456a-1190-625/the-fifth-victim-of-the-london-bridge-terror-attacks-has-been-named-while-4-others-are-missing.jpg', '2017-06-07 06:28:23', 2, '2017-06-07T05:40:00+00:00', 'BUSINESS-INSIDER-UK'),
(107, 'Matt Weinberger, Business Insider', 'Apple is trying to become Microsoft faster than Microsoft can become Apple', 'Apple is making the iPad more like a PC, even as Microsoft is making Windows more like an iPad.', 'http://uk.businessinsider.com/apple-ipad-pro-versus-microsoft-surface-pro-2017-6', 'http://static5.uk.businessinsider.com/image/593720095a1d1b34097a74ea-1190-625/apple-is-trying-to-become-microsoft-faster-than-microsoft-can-become-apple.jpg', '2017-06-07 06:28:23', 3, '2017-06-06T21:32:57+00:00', 'BUSINESS-INSIDER-UK'),
(108, 'Kate Taylor, Business Insider', 'Bars are opening early on Thursday so people can drink Russian vodka while watching ex-FBI Director Comey testify', 'Bars in Texas and Washington, DC are opening early to screen Comey''s testimony, which is scheduled to begin at 10 a.m. on Thursday.', 'http://uk.businessinsider.com/bars-open-early-for-comey-testimony-2017-6', 'http://static4.uk.businessinsider.com/image/59186c05dd089595698b491a-1190-625/bars-are-opening-early-on-thursday-so-people-can-drink-russian-vodka-while-watching-ex-fbi-director-comey-testify.jpg', '2017-06-07 06:28:23', 4, '2017-06-06T20:46:07+00:00', 'BUSINESS-INSIDER-UK'),
(109, 'Steve Kovach, Business Insider', 'Apple announced the future this week, and you probably didn''t even notice', 'Apple put the groundwork in place for the next wave of computing during its WWDC conference, but if you were looking for the next flashy product, you missed...', 'http://uk.businessinsider.com/apple-wwdc-announcements-roadmap-for-future-2017-6', 'http://static1.uk.businessinsider.com/image/59374718da6dde394915de96-1190-625/apple-announced-the-future-this-week-and-you-probably-didnt-even-notice.jpg', '2017-06-07 06:28:23', 5, '2017-06-07T00:19:38+00:00', 'BUSINESS-INSIDER-UK'),
(110, 'Michelle Mark, Business Insider', 'Trump''s statements about Qatar ''funding extremism'' directly contradict his own State Department''s stance', '"Our relationship with Qatar is one that''s strong," State Department spokeswoman Heather Nauert told reporters Tuesday.', 'http://uk.businessinsider.com/trumps-qatar-statements-directly-contradict-state-department-2017-6', 'http://static3.uk.businessinsider.com/image/5921c4c4dd08950c3c8b4720-1190-625/trumps-statements-about-qatar-funding-extremism-directly-contradict-his-own-state-departments-stance.jpg', '2017-06-07 06:28:23', 6, '2017-06-06T20:52:05+00:00', 'BUSINESS-INSIDER-UK'),
(111, 'Tyler Lauletta, Business Insider', 'How the richest soccer clubs compare to the richest NFL teams in 2017', 'The top European football clubs make more money than top NFL teams', 'http://uk.businessinsider.com/richest-soccer-clubs-nfl-football-teams-2017-2017-6', 'http://static2.uk.businessinsider.com/image/5936fa6d5a1d1b32cd09f6b6-1190-625/how-the-richest-soccer-clubs-compare-to-the-richest-nfl-teams-in-2017.jpg', '2017-06-07 06:28:23', 7, '2017-06-06T18:53:00+00:00', 'BUSINESS-INSIDER-UK'),
(112, 'Erin Brodwin, Business Insider', 'A Stanford researcher is pioneering a dramatic shift in how we treat depression — and you can try her new tool right now', 'Meet Woebot, an AI-powered chatbot designed using cognitive-behavioral therapy, one of the most heavily researched clinical approaches to treating depression.', 'http://uk.businessinsider.com/stanford-therapy-chatbot-depression-anxiety-woebot-2017-6', 'http://static3.uk.businessinsider.com/image/5936d27f5a1d1b31895611a3-1190-625/a-stanford-researcher-is-pioneering-a-dramatic-shift-in-how-we-treat-depression--and-you-can-try-her-new-tool-right-now.jpg', '2017-06-07 06:28:23', 8, '2017-06-06T16:00:00+00:00', 'BUSINESS-INSIDER-UK'),
(113, 'Áine Cain, Business Insider', 'The ''two pizza rule'' is Amazon CEO Jeff Bezos’ secret to productive meetings', 'Jeff Bezos thinks large meetings are unproductive. That''s why he has a "two pizza" rule.', 'http://uk.businessinsider.com/amazon-ceo-jeff-bezos-two-pizza-rule-productive-meetings-2017-6', 'http://static1.uk.businessinsider.com/image/593701095a1d1b333b4a10a8-1190-625/the-two-pizza-rule-is-amazon-ceo-jeff-bezos-secret-to-productive-meetings.jpg', '2017-06-07 06:28:23', 9, '2017-06-06T19:22:00+00:00', 'BUSINESS-INSIDER-UK'),
(114, 'Dina Spector', 'Business Insider UK is looking for talented people — apply now', 'Business Insider UK is looking for talented people who are sharp, fast, and have a knack for telling stories in an original and compelling way.', 'http://uk.businessinsider.com/business-insider-uk-job-openings-2016-12', 'http://static4.uk.businessinsider.com/image/5852756c0874531a008b4bfd-1190-625/business-insider-uk-is-looking-for-talented-people--apply-now.jpg', '2017-06-07 06:28:23', 10, '2016-12-15T15:26:33+00:00', 'BUSINESS-INSIDER-UK'),
(115, NULL, 'US says China likely to build military base in Pakistan - Times of India', '"China most likely will seek to establish additional military bases in countries with which it has a longstanding friendly relationship and similar strategic interests, such as Pakistan," a Pentagon report released on Tuesday said.', 'http://timesofindia.indiatimes.com/world/us/us-says-china-likely-to-build-military-base-in-pakistan/articleshow/59028853.cms', 'http://timesofindia.indiatimes.com/photo/msid-59028854/59028854.jpg?172779', '2017-06-07 06:28:24', 1, '2017-06-07T11:36:00Z', 'TIMES OF INDIA'),
(116, 'Shilpa Phadnis', 'Indian IT companies sharply cut H-1B dependence - Times of India', 'A report notes that the global trend is for corporate clients of both US and India-based IT services companies to demand digital engineering and more sophisticated services, including better data analysis that requires fewer workers and more advanced technology.', 'http://timesofindia.indiatimes.com/business/indian-it-companies-sharply-cut-h-1b-dependence/articleshow/59026749.cms', 'http://timesofindia.indiatimes.com/photo/msid-59028525/59028525.jpg?427833', '2017-06-07 06:28:24', 2, '2017-06-07T08:26:00Z', 'TIMES OF INDIA'),
(117, 'Dipak K Dash', 'Modi govt gears up for 2019 polls with ‘a project a day’ - Times of India', 'The identified highway projects covering nearly 15,000km entail investment of about Rs 1.8 lakh crore. The total number of jobs created by these projects will also be highlighted. Works identified by the shipping ministry are related to port development and some projects relating to the development of waterways.', 'http://timesofindia.indiatimes.com/india/modi-govt-gears-up-for-2019-polls-with-a-project-a-day/articleshow/59026404.cms', 'http://timesofindia.indiatimes.com/photo/msid-59026439/59026439.jpg?81179', '2017-06-07 06:28:24', 3, '2017-06-07T01:40:00Z', 'TIMES OF INDIA'),
(118, NULL, 'Govt feels RBI is not doing enough to boost growth - Times of India', 'An influential section within the government believes the RBI has been unsympathetic to its concern over persisting high interest rates and reluctant to take advantage of the room afforded by a comfortable fiscal situation and inflation, which is within the central bank’s comfort zone of 2-6%.', 'http://timesofindia.indiatimes.com/business/india-business/govt-feels-rbi-is-not-doing-enough-to-boost-growth/articleshow/59026237.cms', 'http://timesofindia.indiatimes.com/photo/msid-59026220/59026220.jpg?34505', '2017-06-07 06:28:24', 4, '2017-06-07T10:27:00Z', 'TIMES OF INDIA'),
(119, NULL, 'Rahul Gandhi likely to take over as Congress chief in October - Times of India', 'For the Gandhi clan, it would be the fifth member to hold the reins of Congress. the October elevation would provide a testing time in view of a string of end-year assembly polls.', 'http://timesofindia.indiatimes.com/india/rahul-gandhi-likely-to-take-over-as-congress-chief-in-october/articleshow/59026797.cms', 'http://timesofindia.indiatimes.com/photo/msid-59026784/59026784.jpg?73372', '2017-06-07 06:28:24', 5, '2017-06-07T10:59:00Z', 'TIMES OF INDIA'),
(120, 'Jayaraj Sivan', 'MLAs flex muscles as Edappadi K Palaniswami''s grip loosens - Times of India', 'CHENNAI:What started off as a muted revolt of 10 MLAs against the Edappadi K Palaniswami government on Saturday -the day AIADMK (Amma) deputy general secretary T T V Dhinakaran returned to Chennai after his release from Tihar jail -swelled into a 27-strong group of legislators by Tuesday evening, raising doubts about the continuation of the present government which has a slender margin of just six MLAs in the 233-member House.', 'http://timesofindia.indiatimes.com/city/chennai/mlas-flex-muscles-as-edappadi-k-palaniswamis-grip-loosens/articleshow/59030260.cms', 'http://timesofindia.indiatimes.com/photo/msid-59030248/59030248.jpg?204610', '2017-06-07 06:28:24', 6, '2017-06-07T10:20:00Z', 'TIMES OF INDIA'),
(121, 'Robin Sinha', 'New Apple iPad Pro, MacBook Pro and iMac India prices announced | Gadgets Now', 'The Wi-Fi only variants with 64GB, 256GB and 512GB storage will cost Rs 52,900, Rs 60,900 and Rs 76,900 respectively.', 'http://www.gadgetsnow.com/tech-news/new-apple-ipad-pro-macbook-pro-and-imac-india-prices-announced/articleshow/59030944.cms', 'http://www.gadgetsnow.com/photo/59030945.cms', '2017-06-07 06:28:24', 7, NULL, 'TIMES OF INDIA'),
