(169, 'Tripp Mickle', 'Apple’s New Big Bet: Augmented Reality', 'Apple Inc. set its sights on a new target: becoming the world’s largest platform for augmented reality.', 'https://www.wsj.com/articles/apples-new-big-bet-augmented-reality-1496779717', 'https://si.wsj.net/public/resources/images/BN-TT167_366iU_TOP_20170606155049.jpg', '2017-06-07 06:28:26', 8, '2017-06-06T20:08:00Z', 'the-wall-street-journal'),
(170, 'Felicia Schwartz', 'Trump Sides With Saudis, Other Gulf States in Rift With Qatar', 'President Donald Trump, by siding with Saudi Arabia and other regional countries in a dispute with Qatar over allegations the emirate supports terrorism, stepped into a dispute among allies and generated confusion about U.S. policy toward the region.', 'https://www.wsj.com/articles/trump-says-in-tweet-he-discussed-qatar-with-arab-leaders-1496758326', 'https://si.wsj.net/public/resources/images/BN-TS927_trumpq_TOP_20170606094923.jpg', '2017-06-07 06:28:26', 9, '2017-06-06T14:12:00Z', 'the-wall-street-journal'),
(171, 'Justin Lahart', 'Some Inconvenient Facts for the Fed', 'The Federal Reserve is primed to raise rates next week despite a slow-growth economy showing weak wage gains for workers, cooling inflation and dimming prospects for near-term fiscal stimulus.', 'https://www.wsj.com/articles/some-inconvenient-facts-for-the-fed-1496770646', 'https://si.wsj.net/public/resources/images/BN-TT045_35Ann_TOP_20170606132731.jpg', '2017-06-07 06:28:26', 10, '2017-06-06T17:37:00Z', 'the-wall-street-journal'),
(172, 'Rich McCormick', 'You can watch the first episode of Apple’s reality TV show Planet of the Apps now', 'The first episode of Planet of the Apps — Apple’s Shark Tank-esque reality TV show about app developers — is now available on Apple Music and iTunes. Anyone will be able to watch the first episode...', 'https://www.theverge.com/2017/6/7/15751614/planet-of-the-apps-watch-first-episode-free', 'https://cdn.vox-cdn.com/thumbor/5qXBbNuXyWzfyLCl3j_Qdaw_wB4=/0x2:847x478/1600x900/cdn.vox-cdn.com/uploads/chorus_image/image/55128701/planet_of_the_apps.0.png', '2017-06-07 06:28:26', 1, '2017-06-07T04:01:16Z', 'the-verge'),
(173, 'Sean O''Kane', 'Watch SpaceX’s most recent beachside rocket landing in 4K', 'The fifth on land and 11th overall', 'https://www.theverge.com/2017/6/6/15751008/spacex-falcon-9-landing-video-4k-60p-florida', 'https://cdn0.vox-cdn.com/thumbor/mQKm7wGy7tODsptmf6p2OLYrLfs=/30x0:2509x1298/fit-in/1200x630/cdn0.vox-cdn.com/uploads/chorus_asset/file/8643519/Screen_Shot_2017_06_06_at_9.23.55_PM.png', '2017-06-07 06:28:26', 2, '2017-06-07T01:37:58Z', 'the-verge'),
