(181, 'Adi Robertson', 'First Amendment group threatens to sue Trump for blocking Twitter users', 'A legal group has asked Donald Trump to unblock users who have offended him on Twitter, saying that the blocks violate the First Amendment. In a letter, the Knight First Amendment Institute at...', 'https://www.theverge.com/2017/6/6/15748776/knight-institute-donald-trump-twitter-block-free-speech-letter', 'https://cdn.vox-cdn.com/thumbor/FqFbQduJGVU8fpr7czUkH3JnMiM=/0x166:3000x1854/1600x900/cdn.vox-cdn.com/uploads/chorus_image/image/55121557/691640904.0.jpg', '2017-06-07 06:28:26', 10, '2017-06-06T19:36:24Z', 'the-verge'),
