(187, 'Al Jazeera', 'Trump weighs in on Qatar rift with Gulf neighbours', 'US President Donald Trump throws his weight behind efforts to isolate Qatar over claims it supports ''extremism''.', 'http://www.aljazeera.com/news/2017/06/trump-weighs-qatar-rift-gulf-neighbours-170606135301513.html', 'http://www.aljazeera.com/mritems/Images/2017/6/6/a6bbc8d8472a4279b51bc90b7ee22768_18.jpg', '2017-06-07 06:28:26', 6, '2017-06-06T23:22:34Z', 'Al Jazeera English'),
