(193, 'Eric Berger', 'Citing costs, US Air Force turns to SpaceX for its next spy plane launch', '“There are some very exciting things happening in commercial space.”', 'https://arstechnica.com/science/2017/06/spacex-will-launch-the-air-forces-secretive-space-plane-on-its-next-flight/', 'https://cdn.arstechnica.net/wp-content/uploads/2017/06/wilson1-760x380.jpg', '2017-06-07 06:28:27', 2, '2017-06-06T23:56:40Z', 'Ars Technica'),
(194, 'Dan Goodin', 'You’ll never guess where Russian spies are hiding their control servers', 'Turla uses social media and clever programming techniques to cover its tracks.', 'https://arstechnica.com/security/2017/06/russian-hackers-turn-to-britney-spears-for-help-concealing-espionage-malware/', 'https://cdn.arstechnica.net/wp-content/uploads/2017/06/bs-instagram-760x380.jpg', '2017-06-07 06:28:27', 3, '2017-06-06T22:40:54Z', 'Ars Technica'),
