(240, 'MIKE SCHNEIDER', 'After Pulse attack, gay Latino community seeks strength', 'ORLANDO, Fla. (AP) — Ricardo Negron never kissed his boyfriend in front of conservative relatives. Carlos Guillermo Smith was once attacked by anti-gay students at a college party. After coming out in high school, Marco Quiroga left his mother''s home and became temporarily homeless. Many gay Latinos in Orlando have endured indignities, rejection or violence because of their sexual orientation. But in the year since a gunman killed 49 people at the Pulse nightclub, these men and others have sought to strengthen their wounded community, forming support groups and community organizations, seeking seats at the tables of power, and creating a foundation to champion gays and Latinos.', 'https://apnews.com/6bef5010330e47ca823502801276bb8c', 'https://storage.googleapis.com/afs-prod/media/media:a91a3738d68d4b5bac578eb3ee18b978/2640.jpeg', '2017-06-07 18:49:10', 1, '2017-06-07T18:39:46+00:00', 'Associated press'),
(241, 'ERIC TUCKER', 'Comey to Congress: President Trump told him "I need loyalty"', 'WASHINGTON (AP) — Former FBI Director James Comey will say in his opening statement to a congressional hearing that President Donald Trump told him, "I need loyalty. I expect loyalty" during a January dinner, according to documents released a day ahead of his planned testimony. Comey is set to testify before the Senate Intelligence committee Thursday. His prepared statement was released Wednesday afternoon. In the statement, Comey said he and Trump dined together privately in January. During the meal, he said Trump asked him if he wanted to remain on as FBI director. Comey said he replied that he wanted to serve out his ten-year term and "was not on anybody''s side politically."', 'https://apnews.com/99b408fbac834adf9364fa8db55aaa55', 'https://storage.googleapis.com/afs-prod/media/media:34b82c7b429a48bfa5512d97574977d1/2928.jpeg', '2017-06-07 18:49:10', 3, '2017-06-07T18:19:56+00:00', 'Associated press'),
(242, 'SADIE GURMAN and CATHERINE LUCEY', 'New Trump FBI pick represented Christie in Bridgegate case', 'WASHINGTON (AP) — Christopher Wray, a white-collar defense lawyer with a strong law enforcement background who represented New Jersey Gov. Chris Christie in the Bridgegate scandal, was announced Wednesday as President Donald Trump''s pick to head the FBI. In an early morning two-sentence tweet, Trump said he intended to nominate Wray, a high-ranking official in George W. Bush''s Justice Department. That word came one day before the FBI director that Trump fired last month, James Comey, was to testify in public on Capitol Hill for the first time since his dismissal.', 'https://apnews.com/11248f84eb7a4b619d5b720857ed90be', 'https://storage.googleapis.com/afs-prod/media/media:807624dd31d74dd38e4641d8ccac79f6/1076.jpeg', '2017-06-07 18:49:10', 4, '2017-06-07T17:21:21+00:00', 'Associated press'),
(243, 'JILL COLVIN', 'Trump pushes public works agenda, health care on Ohio visit', 'CINCINNATI (AP) — President Donald Trump is using the Ohio River as the backdrop for a speech about upgrading roads, bridges and waterways, but before talking about overhauling aging infrastructure, he urged the Senate to follow the House and vote on a bill to overhaul the health care system. "Now it''s the Senate''s turn to act," Trump said after meeting aboard Air Force One with a pair of families the White House described as "victims" of the Obama-era health care law that the president and congressional Republicans want to repeal and replace.', 'https://apnews.com/29abadfad07a4227aef0cd8e3031815e', 'https://storage.googleapis.com/afs-prod/media/media:9a1bb688446b4c0fa6fee2930012935b/3000.jpeg', '2017-06-07 18:49:10', 5, '2017-06-07T17:43:01+00:00', 'Associated press'),
(244, 'AMIR VAHDAT and AYA BATRAWY', 'Islamic State claims stunning attack in heart of Iran', 'TEHRAN, Iran (AP) — The Islamic State group claimed responsibility Wednesday for a pair of stunning attacks on Iran''s parliament and the tomb of its revolutionary leader, Ayatollah Ruhollah Khomeini, which killed at least 12 people and wounded more than 40. Tehran Police Chief Gen. Hossein Sajedinia announced late Wednesday night that five suspects had been detained for interrogation, according to a report in the semi-official ISNA news agency. Sajedinia did not offer any further details. The bloodshed shocked the country and came as emboldened Sunni Arab states — backed by U.S. President Donald Trump — are hardening their stance against Shiite-ruled Iran.', 'https://apnews.com/510f0af4615443c08ff7f52c2657bb76', 'https://storage.googleapis.com/afs-prod/media/media:9c7e46166d4143319c8358c25b17d260/3000.jpeg', '2017-06-07 18:49:10', 6, '2017-06-07T18:39:39+00:00', 'Associated press'),
(245, 'ESTHER HTUSAN', 'Myanmar military plane with 120 aboard goes missing', 'YANGON, Myanmar (AP) — A military transport plane with 120 people on board went missing Wednesday on a flight from southern Myanmar to Yangon, a military spokesman said. There were fears it may have crashed into the ocean, since its route would have taken it over the Andaman Sea. Gen. Myat Min Oo said the Chinese-made Y-8 turboprop aircraft was carrying 106 passengers — mostly families of military personnel — and 14 crew members when it went missing Wednesday afternoon. In an earlier statement, the number of passengers was said to be 90. It is not unusual for such flights to carry civilians to offset transportation costs for military families stationed in the somewhat remote south.', 'https://apnews.com/3cb56efff093485cbb3eaca8f4bb9d59', 'https://storage.googleapis.com/afs-prod/media/media:aea451b1cf0c420ba8209b7666949e75/1783.jpeg', '2017-06-07 18:49:10', 7, '2017-06-07T17:01:43+00:00', 'Associated press'),
(246, 'JILL LAWLESS', 'UK contenders trade blows on last day of election campaign', 'LONDON (AP) — After a seven-week election campaign that veered from the boredom of staged soundbites to the trauma of two deadly attacks, Britain''s political leaders asked voters Wednesday to choose: Who is best to keep the U.K. safe and lead it out of the European Union? Conservative Prime Minister Theresa May and opposition Labour Party leader Jeremy Corbyn crisscrossed the country on the final day of campaigning, trying to woo voters with rival plans for Brexit, building a fairer society and combating a terrorist threat made all too immediate by attacks in Manchester and London.', 'https://apnews.com/1b717b7a9d1449c8b1a12af3bbb44926', 'https://storage.googleapis.com/afs-prod/media/media:edcedb821587412ca46f7f6e2ebfe22d/1958.jpeg', '2017-06-07 18:49:10', 8, '2017-06-07T18:05:42+00:00', 'Associated press'),
(247, 'MARYCLAIRE DALE and MICHAEL R. SISAK', 'Cosby''s accuser denies they were romantically involved', 'NORRISTOWN, Pa. (AP) — Bill Cosby''s accuser brushed off suggestions they had a romantic relationship before he allegedly drugged and assaulted her, as the comedian''s lawyers labored Wednesday to pick apart her story at his sex-crimes trial. The defense resumed its cross-examination of Andrea Constand one day after she broke her long public silence about Cosby by testifying that he gave her three blue pills and then violated her with his fingers in 2004 as she lay paralyzed on a couch, unable to tell him to stop, at his suburban Philadelphia home.', 'https://apnews.com/9b22db24453d4e7ab7d30427cd28e86d', 'https://storage.googleapis.com/afs-prod/media/media:7b9124fb12d443d2a541f88d6d8996fa/3000.jpeg', '2017-06-07 18:49:10', 9, '2017-06-07T18:13:56+00:00', 'Associated press'),
(248, 'MALCOLM RITTER', 'This is us: Earliest fossils of our species found in Morocco', 'NEW YORK (AP) — How long has our species been around? New fossils from Morocco push the evidence back by about 100,000 years. The bones, about 300,000 years old, were unearthed thousands of miles from the previous record-holder, found in fossil-rich eastern Africa. The new discovery reveals people from an early stage of our species'' evolution, with a mix of modern and more primitive traits. "They are not just like us," said Jean-Jacques Hublin, one of the scientists reporting the find. But they had "basically the face you could meet on the train in New York."', 'https://apnews.com/890d8860375241b3a4a201898420f8fe', 'https://storage.googleapis.com/afs-prod/media/media:2d2c630490974f28a769d590a38b718c/2048.jpeg', '2017-06-07 18:49:10', 10, '2017-06-07T17:08:51+00:00', 'Associated press'),
